import axios from 'axios';
import {useEffect, useState} from 'react';
import './App.css';

import Header from './components/header.jsx';

const baseURL= "http://localhost:8080";
function App() {
  const [message, setMessage]= useState("Jola");

  useEffect(()=>{
    const getMesseage= async ()=>{
      await axios.get(baseURL).then(res=>{
        setMessage(res.data);
      });
    }
   getMesseage(); 
  }, [message]);
  return (<div>
    <Header />
    <div className="space">
    gh<br/><br/><br/><br/><br/><br/><br/><br/>hj<br/><br/><br/><br/><br/>kk<br/><br/><br/><br/><br/><br/><br/><br/>ukk<br/><br/><br/><br/><br/><br/>u</div>
  </div>
  );
}

export default App;
